(34, '2nd Special Passport Drive', '<h3>                                                           is getting scheduled soon; open to Students & Faculty </h3>\n\n<h3>Please broadcast and make use of this opportunity</h3>\n\n<h3>1st round was a grand success; > 800 members utilized (100% result)', 0, '2017-09-15 07:20:47', '2017-09-30 07:20:47', 'info', '<p>--- Please contact Dr. C P Rama Krishna (ramakrishna@raghueducational.org)</p>\n'),
(35, '1st Year 1st Mid Questions', '<p>Dear 1st year REC Faculty, Please send 1st Year 1st Mid Important Questions to raghu.midexams2017@gmail.com by 3:30 PM Tomorrow (23rd Sep 2017). </p>\n\n<p> </p>\n', 1, '2017-09-22 12:27:39', '2017-09-23 12:27:39', 'red', '<p>--Management</p>\n');
